import React from 'react'
import './SideMenu.css'

const SideMenu = ({ userMessage }) => {
  return (
    <aside className='sidemenu'>
      <div className='sidemenu-button'>
        <span>+</span>
        Novo chat
      </div>
      <div className='user-message'>
        <p>{userMessage}</p>
      </div>
    </aside>
  );
}

export default SideMenu;
